import { Grid, Image, Label, Segment, Container, Card,Input, Divider,Icon } from 'semantic-ui-react'

class Bio extends Component {
  render() {
    return (
        <Container>
<Input icon={<Icon name='pencil' inverted circular link />} placeholder='Search...' />
<br/> 
<Input icon={<Icon name='pencil' inverted circular link />} placeholder='Search...' />
